import { Component } from "react";
import { Link } from "react-router-dom";

export default class Event extends Component {
    constructor(props) {
        super(props);

        if (props.model) {
            this.state = props.model;
        }
    }

    componentDidMount() {
        if (!this.state) {
            this.setState({
                event: {
                    id: this.props.eventID,
                    name: "event name",
                    orgID: 2,
                    description: "event description",
                    startTime: new Date(),
                    endTime: new Date(),
                    tags: ["gaming", "greek"],
                    location: "price center",
                    created: new Date(),
                    updated: new Date(),
                },
                org: {
                    name: "org name",
                },
            })
        }
    }

    previewSquare() {

    }

    previewWide() {
        console.log(this.state);
        return (
            <div>
                <h2>
                    <Link to={`/events/${this.state.event.id}`}>{this.state.event.name}</Link>
                </h2>
                <table>
                    <tr>
                        <tc>By: </tc>
                        <tc>
                            <Link to={`/orgs/${this.state.org.id}`}>{this.state.org.name}</Link>
                        </tc>
                    </tr>
                    <tr>
                        <tc>On: </tc>
                        <tc>{this.state.event.startTime.toISOString()}</tc>
                    </tr>
                </table>
            </div>
        );
    }

    render() {
        if (!this.state) {
            return <div/>;
        }

        switch (this.props.preview) {
        case "square":
            return this.previewSquare()
        case "wide":
            return this.previewWide()
        }

        return (
            <div>
                <h2>
                    <Link to={`/events/${this.state.event.id}`}>{this.state.event.name}</Link>
                </h2>
                <table>
                    <tr>
                        <tc>By: </tc>
                        <tc>
                            <Link to={`/orgs/${this.state.org.id}`}>{this.state.org.name}</Link>
                        </tc>
                    </tr>
                    <tr>
                        <tc>On: </tc>
                        <tc>{this.state.event.startTime.toISOString()}</tc>
                    </tr>
                    <tr>
                        <tc>Until: </tc>
                        <tc>{this.state.event.endTime.toISOString()}</tc>
                    </tr>
                    <tr>
                        <tc>At: </tc>
                        <tc>{this.state.event.location}</tc>
                    </tr>
                </table>
            </div>
        );
    }
}
